// Greeting.js
import React from 'react';

function Greeting() {
  return (
    <section style={{textAlign: 'center', margin: '2rem 0'}}>
      <h1>Selamat Tahun Baru 2026!</h1>
      <p>Semoga tahun ini penuh kebahagiaan, petualangan, dan momen berkesan untukmu!</p>
    </section>
  );
}

export default Greeting;
